import React from 'react';
export default function Cookies() {
  return <div className="max-w-2xl mx-auto py-20 text-center">
    <h1 className="text-3xl font-bold mb-4">Cookie Policy</h1>
    <p className="text-gray-600 mb-4">We use cookies to improve your experience:</p>
    <ul className="text-left mx-auto max-w-md text-gray-700 dark:text-gray-300">
      <li className="mb-2">• Cookies help us remember your login</li>
      <li className="mb-2">• Analytics cookies help us improve the site</li>
      <li className="mb-2">• You can disable cookies in your browser settings</li>
    </ul>
  </div>;
}
